 const target_materials = ["plastic", "aluminium", "gold", "polypropylene"];
 const target_thickness_range = [0.1, 0.895];
 const pulse_width_range = [30, 12,900];
 const energy_range = [1.0, 10.0];
 const spot_size_range = [2.13, 60];
 const intensity_range = [5.10e20, 1.05e18];
 const power_range = [6.23e13, 3.83e14];
 const cutoff_energy_range = [3.3, 95];

 let generated_samples = [];

 // Loop through all possible combinations of features
 for (let i = 0; i < target_materials.length; i++) {
 for (let j = 0; j < target_thickness_range.length; j++) {
 for (let k = 0; k < pulse_width_range.length; k++) {
 for (let l = 0; l < energy_range.length; l++) {
 for (let m = 0; m < spot_size_range.length; m++) {
 for (let n = 0; n < intensity_range.length; n++) {
 for (let o = 0; o < power_range.length; o++) {
 for (let p = 0; p < cutoff_energy_range.length; p++) {
 // Create a new sample with the current feature values
 const sample = {
 target_material: target_materials[i],
 target_thickness: target_thickness_range[j],
 pulse_width: pulse_width_range[k],
 energy: energy_range[l],
 spot_size: spot_size_range[m],
 intensity: intensity_range[n],
 power: power_range[o],
 cutoff_energy: cutoff_energy_range[p]
 };
 // Add the new sample to the generated samples array
 generated_samples.push(sample);
 }
 }
 }
 }
 }
 return generated_samples;
 }

